import React from "react";
import styled from "styled-components";
const EffectDiv = styled.div`
  width: 17rem;
  height: 4rem;
  background: #750bc9;
  filter: blur(2px);
  border-radius: 50px;
`;
const Btn = styled.div`
  line-height: 4rem;
  font-size: 1.5rem;
  margin: 1rem;
  background-color: #fff;
  border-radius: 50px;
  z-index: 99;
`;
export const StartBtn = () => {
  return (
    <BtnWrap>
      <EffectDiv>
        <Btn>Start</Btn>
      </EffectDiv>
    </BtnWrap>
  );
};

export const AccountBtn = () => {
  return (
    <EffectDiv>
      <Btn>회원가입/로그인</Btn>
    </EffectDiv>
  );
};
